import React, { Component } from 'react'
import empty from "../../../styles/empty.png"
import half from "../../../styles/half.png"
import full from "../../../styles/full.png"
import "./rating.scss"

function getStar(value){
    switch(value){
        case 0:
            return empty
        case 50:
            return half
        case 100:
            return full
        default:
            return empty
    }
}
export default class Rating extends Component {
    render() {
        return (
            <div>
                <img className="star" src={getStar(50)} alt=""/>
            </div>
        )
    }
}
